(function () {
  try {
    const gameCommands = game.modding.commands;
    function findShip(command) {
      const ship = game.findShip(Number(id = command.split(' ')[1]));
      return ship ? ship : echo(`Failed finding ship (ID: ${id})`);
    }
    gameCommands.player_list = function () {
      echo("\nList of players(ids) and their data:");
      if (game.ships.length == 0) return
      for (let ship of game.ships) echo(`${ship.id}: ${ship.name}`);
    }
    gameCommands.timeout = function (command) {
      const ship = findShip(command);
      if (ship) timeout(ship); else return echo(`${ship.name}(${ship.id}) was removed timed-out.`);;
      echo(`${ship.name}(${ship.id}) was timed-out.`);
    }
    gameCommands.kick = function (command) {
      const ship = findShip(command);
      if (ship) ship.gameover?.({ "": "" }); else return echo('');
      echo(`${ship.name}(${ship.id}) was kicked.`);
    };
    gameCommands.announce = command => game.ships.forEach(ship => announcement(ship, command.split(' ').slice(1).join(' ')))
  } catch (error) { }
})();
class UI {
  constructor({ id = '', position = [0, 0, 0, 0], clickable = false, visible = true, shortcut, components = [] }) {
    this.id = id
    this.position = position
    this.clickable = clickable
    this.visible = visible
    this.shortcut = shortcut
    this.components = components
  }
  display(ship, ui = {}) { ship?.setUIComponent(Object.assign({}, this, ui)) }
  hide(ship) { this.display(ship, { position: [0, 0, 0, 0], shortcut: undefined, visible: false, clickable: false, components: [] }) }
}
class LIST_UI {
  #ui = {};
  addUI(name, ...uis) {
    if (!this.#ui[name]) this.#ui[name] = {}
    uis.flat(Infinity).map(ui => this.#ui[name][ui.id] = ui)
  }
  get ui() { return this.#ui }
  getList(name) { return Object.values(this.#ui[name] ?? {}) }
}
class GRIDS {
  constructor(position, prefix = ' ') {
    this.prefix = prefix
    this.position = position
    this.grids = {}
  }
  #addGrids(rows, columns, type = 'x') {
    const width = this.position[2] / rows, height = this.position[3] / columns, [x0, y0] = this.position
    if (type == 'y') return this.grids[[rows, columns, type].join(' ')] = Array(columns).fill().map((_, y) => Array(rows).fill().map((_, x) => [x0 + x * width, y0 + y * height, width, height]))
    return this.grids[[rows, columns, type].join(' ')] = Array(rows).fill().map((_, x) => Array(columns).fill().map((_, y) => [x0 + x * width, y0 + y * height, width, height]))
  }
  getMergeGrid(type, [x, y], numX, numY) {
    if (!this.grids[type.join(this.prefix)]) this.#addGrids(...type)
    const [x0, y0, width, height] = this.grids[type.join(this.prefix)][--x][--y]
    return [x0, y0, width * numX, height * numY]
  }
  getGrids(rows, columns, type) {
    let grids = this.grids[[rows, columns, type].join(this.prefix)]
    if (grids) return grids
    this.#addGrids(rows, columns, type)
    return this.getGrids(rows, columns, type)
  }
}
